import logo from './logo.svg';
import './App.css';
import Questionnaire from './components/Questionnaire';

function App() {
  return (
    <section className="App">
      <header className="App-header">
        <h1>Quiz-App</h1>
        <Questionnaire/>
      </header>
    </section>
  );
}

export default App;
